export default {
	myFunGetCommAddr: () => {
    let addr = "";

    if (appsmith.store.vayCrComAddr1 && appsmith.store.vayCrComAddr1.replace(/\s/g, '').length) {
        addr = `${addr}${appsmith.store.vayCrComAddr1}, `;
    }
    if (appsmith.store.vayCrComAddr2 && appsmith.store.vayCrComAddr2.replace(/\s/g, '').length) {
        addr = `${addr}${appsmith.store.vayCrComAddr2}, `;
