    if (appsmith.store.vayCrComCity && appsmith.store.vayCrComCity.replace(/\s/g, '').length) {
        addr = `${addr}${appsmith.store.vayCrComCity}, `;
    }
    if (appsmith.store.vayCrComDistrict && appsmith.store.vayCrComDistrict.replace(/\s/g, '').length) {
        addr = `${addr}${appsmith.store.vayCrComDistrict}, `;
    }
    if (appsmith.store.vayCrComState && appsmith.store.vayCrComState.replace(/\s/g, '').length) {
        addr = `${addr}${appsmith.store.vayCrComState}, `;
    }
    if (appsmith.store.vayCrComCountry && appsmith.store.vayCrComCountry.replace(/\s/g, '').length) {
        addr = `${addr}${appsmith.store.vayCrComCountry}, `;
    }
    if (appsmith.store.vayCrComPinCode && appsmith.store.vayCrComPinCode.toString().replace(/\s/g, '').length) {
        addr = `${addr}${appsmith.store.vayCrComPinCode}.`;
    }

    return addr;
	},
